import React from 'react';
import { BrowserRouter } from 'react-router-dom';

import Header from '../../components/Header/Header';

class Root extends React.Component {
    render() {
        return (
            <BrowserRouter>
                <Header />
            </BrowserRouter>
        )
    }
}

export default Root;
